INSERT INTO `halaman` (`id`, `nama`, `isi`, `created_at`, `updated_at`) VALUES (1, 'tentang', '<p style=\"text-align: justify; \"><b>SIPADU </b>adalah aplikasi <b>S</b>istem <b>I</b>nformasi Ter<b>PADU </b>digunakan untuk menanggapi laporan masyarakat dapat tertangani lebih cepat agar terciptanya citra yang baik di masyarakat terhadap pelaksanaan tugas dan kegiatan <b>Satuan Polisi Pamong Praja Kota Banjarmasin</b> dan untuk mendukung tercapainya visi Kota Banjarmasin, yakni <b>\"Kayuh Baimbai Menuju Banjarmasin Baiman\"</b>&nbsp;(Bertakwa, Aman, Indah, Maju, Amanah dan Nyaman).</p>', NULL, '2022-07-28 01:32:54');
INSERT INTO `halaman` (`id`, `nama`, `isi`, `created_at`, `updated_at`) VALUES (2, 'profil', '<p style=\"text-align: justify; \"><b>Satpol PP Kota Banjarmasin</b>&nbsp;adalah perangkat Pemerintah Daerah dalam memelihara <b>Ketentraman</b> dan <b>Ketertiban Umum</b> serta menegakkan <b>Peraturan Daerah</b> Kota Banjarmasin.</p>', NULL, '2022-07-28 01:39:26');
