INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (6, 4, 39, 'Jalan Pramuka kecamatan Banjarmasin Timur khususnya didepan indomaret depan halte semanda', 'Ada tukang pentol yang sering mangkal tepat depan indomaret dan atm sehingga pengunjung terganggu akses keluar masuk tempat tersebut', '29-07-2022-8770B5262FBF-6FAF-4FB9-8998-CDF32E2FA4D9.jpeg', 23, '2022-07-29 07:19:02', '2022-07-29 08:39:02', 1, 2, 67, 'Izin melaporkan tim yustisi reaksi cepat melakukan peneguran terhadap paman pentol yang mangkal di depan indomaret semanda', '29-07-2022-63725D92F0EB-F092-48DC-A9FC-44D088534B08.png');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (8, 1, 3, 'simpang 4 belitung', 'tolong pang buhan pian hentikan buhan pengamen simpangan sini,mulai jm6 pagi smpai jam10 malam kdd beampihan,sampai begantian ny mngamen saking aman ny dari rajia pian.Mauk lagi bila pagi buhan ny tu rancak bekamih di higa toko kami (toko aki Virgo,toko Reparasi Kunci). Sudah bekali-kali kami tagur masih aja diulangi.\r\nTolong banar pang buhan pian tindak,bejagaan di simpangan sini.Klo perlu tempat jaga,ulun besedia pian bejagaan dari toko ulun.Jangan kalah lwn pengamen ny yg bejagaan seharian di seberang toko ulun,begantian begiliran ny.\r\nTolong banar pa ai tindakan buhan pian,sudah liwar uyuh kami mehadapi buhan pengamen nih.\r\nTerima kasih,mudahan di ridhoi Allah buhan pian bertugas.. aamiin', '02-08-2022-7938PicsArt_08-02-08.26.16.jpg', 50, '2022-08-02 00:27:57', '2022-08-02 02:02:39', 2, 2, 158, 'Simpang 4 belitung terpantau kondusif', '02-08-2022-9151IMG-20220802-WA0133.jpg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (10, 2, 16, 'jalan pahlawan gang 06 Oktober kelurahan seberang mesjid, Banjarmasin', 'Di tempat saya tinggal ada rencana pembangunan sebuah ruko yang di gadang-gadang bakal menjadi minimarket penyedia kebutuhan hidup sehari - hari, tempat tersebut berdekatan dengan tempat pemakaman umum yang mana di makam tersebut dataran nya rendah, sering terjadi banjir bila mana intensitas hujan sangat tinggi & air pasang sungai. Biasanya sebelum ada pembangunan ruko tersebut air dapat mengalir dengan lancar tanpa ada yang tersumbat, semenjak ruko tersebut dibangun maka air hujan dengan intensitas tinggi sangat berdampak besar terjadinya banjir karena saluran air nya tertutup oleh berdirinya ruko tersebut. Ditambah lagi di lingkungan tempat saya tinggal ada warung makan yang berdiri tapi tidak memiliki saluran pembuangan air kotor, jadi pihak warung tersebut membuang air kotor tersebut di saluran kecil yang ada di dalam gang tempat saya tinggal yang mengakibatkan bau tidak sedap bekas membersihkan sisa-sisa makanan tersebut. Belum lagi nanti pas turun hujan maka tercampurlah antara air hujan dengan air bekas membersihkan sisa-sisa makanan. Di depan halaman rumah saya kalau terjadi hujan deras maka terjadi banjir karena saluran air tertutup oleh pembangunan ruko tersebut & air hujan nya tercampur dengan air bekas membersihkan sisa-sisa makanan.', '02-08-2022-445WhatsApp Image 2022-08-02 at 14.45.49.jpeg', 68, '2022-08-02 06:53:27', '2022-08-02 07:00:05', 14, 1, NULL, NULL, NULL);
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (11, 2, 16, 'Jalan Pahlawan gang 06 Oktober Kelurahan Seberang Mesjid, Banjarmasin', 'Selamat siang, ijin menyampaikan bahwa di dekat ruamh saya ada sebuah warung makan yang bernama Warung Soto Sate Pahlawan yang sudah lama berdiri yang mana warung tersebut tidak memiliki lahan parkir baik itu Roda 2 maupun Roda 4 yang mengganggu aktivitas warga sekitar yang ada di dalam Gang kami. Belum lagi akses Gang kami tidak terlalu lebar yang mana sering banyaknya pengunjung warung tersebut parkir di dalam Gang yang mengakibatkan Mobil warga kami kesusahan untuk masuk ke dalam Gang tersebut, bukan hanya mobil pribadi yang susah masuk tetapi mobil Ambulance, Mobil BPK juga kadang susah untuk masuk ke dalam Gang tersebut karena banyaknya warga yang parkir sembarangan. Untuk perihal kebersihan saya ingin melaporkan bahwa warung tersebut tidak memiliki penampungan Limbah sisa makanan, yang mana limbah tersebut dibuang begitu saja di sekitar Gang rumah kami yang mengakibatkan bau yang tidak sedap. belum lagi pada waktu musim hujan di dalam Gang kami drainase nya tidak ada yang mengakibatkan Banjir air hujan tercampur dengan Air limbah sisa makanan, yang mana air tersebut sering masuk ke dalam halaman rumah saya yang mengakibatkan penyakit gatalan serta Bau yang tidak sedap. mohon untuk di tindak guna menjaga ketertiban & kebersihan lingkungan di sekitar rumah kami. terima kasih', '02-08-2022-1568WhatsApp Image 2022-08-02 at 14.45.48.jpeg', 68, '2022-08-02 07:15:21', '2022-08-02 09:09:27', 20, 2, 137, 'Anggota konfirmasi kepada pemilik warung sate pahlawan untuk membenahi pembuangan air', '02-08-2022-3138IMG-20220802-WA0048.jpg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (12, 5, 48, 'Jalan gerilya muara RT.01 RW.01', 'Kami Keberatan ada PKL disekitaran Jembatan Gerilya Kelayan B menutupi Kios dan Rumah. \r\nPedagang Kaki Lima (PKL) di sepanjang kawasan jembatan Gerilya di Jalan Kelayan B Banjarmasin membuat kami keberatan, pasalnya PKL tersebut menutupi rumah dan kios kami. Sehingga kios dan toko kami sepi akan pembeli, bahkan tidak ada yg menyewa kios dan toko kami lantaran tertutup oleh lapak PKL tersebut, kegiatan para PKL menutupi kios dan rumah kami mulai dari jam 07:00 sampai jam 22:00, sedangkan lapak PKL itu tidak mempunyai izin sama sekali ke pemerintah kota Banjarmasin.\r\nKetika kami meminta kepada para PKL untuk tidak berjualan didepan kios dan rumah kami, para PKL mengatakan mereka menyewa lahan tersebut kepada seorang preman disana, preman tersebut memungut sewa dengan memanfaatkan jalan dan bahu jalan untuk kepentingan mereka .\r\nYang tidak masuk akal, apabila ada yang merobohkan tempat jualannya, pihak preman meminta ganti rugi kekami.\r\nJangan dibiarkan premanisme merajalela dikota Banjarmasin.\r\nSebelumnya sudah ada teguran lisan dan surat peringatan dari kelurahan Tanjung pagar terkait hal keberadaan PKL ditempat tersebut agar segera membongkar lapak mereka dan tidak berjualan lagi, dan memang itu kawasan yang dilarang (zona merah) kenapa ada aktivitas PKL ditempat tersebut. namun dari pihak preman disana mengatakan bahwa teguran lisan dan surat itu palsu.\r\nMohon kepada pemerintah kota Banjarmasin, Satpol PP kota Banjarmasin, Polsek Banjarmasin Selatan, kecamatan Banjarmasin Selatan, kelurahan Tanjung pagar dan dinas terkait untuk menertibkan PKL yang ada disana, karena sebelumnya sudah ada peringatan. \r\nTerimakasih atas perhatian dan dukungannya.', '03-08-2022-6261IMG_20220416_202254.jpg', 73, '2022-08-03 06:16:54', '2022-08-03 08:06:39', 1, 2, 157, 'Negatif aktifitas PKL', '03-08-2022-4219IMG-20220803-WA0062.jpg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (13, 5, 47, 'Turunan jembatan pekauman, Jalan rantau darat', 'Mau melaporkan pak, ada pedagang nasi goreng gerobak yang selalu standby di jalan tempat turun jembatan pekauman jalan tantau darat, berjualan setiap hari jam 3 sore sampai jam 11 malam, dengan adanya penjual tersebut warga sekitar dan beberapa pemilik toko keberatan karena mengganggu arus jalan raya serta akses pengunjung toko. Sudah pernah ditegur tetapi tidak diperdulikan', '09-08-2022-6062A5842297-EFC1-4919-B9B6-F73ED738796B.jpeg', 84, '2022-08-09 00:20:48', '2022-08-09 09:19:39', 1, 2, 157, 'Negatif aktivitas,dikarenakan libur warung nasi goreng nya', '09-08-2022-4890IMG-20220809-WA0071.jpg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (14, 4, 32, 'Di kawasan halte bumi mas', 'Selamat pagi, saya mau melaporkan andanya pemulung dudukan ada menaruh barang barangnya berserakan dan terlihat kumuh, dimohon untuk ditindak lanjuti', '09-08-2022-845960D9C675-E67B-4C94-9743-A9C3B45101A7.jpeg', 84, '2022-08-09 01:18:25', '2022-08-09 02:05:55', 2, 2, 157, 'Menanggapi laporan masyarakat bahwa halte dijadikan tempat istirahat anjal dan gepeng,negatif aktifitas', '09-08-2022-5762IMG-20220809-WA0019.jpg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (15, 2, 10, 'Jln.setoyo s banjarmasin', 'Manusia silver meresahkan masyarakat yang berada di taluk dalam lampu merah TOWER PDAM', NULL, 86, '2022-08-09 04:38:03', '2022-08-09 08:51:43', 2, 2, 157, 'Anggota melakukan pengawasan dipersimpangan sutoyo s.', '09-08-2022-4039IMG-20220809-WA0066.jpg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (18, 3, 30, 'Jl. HKSN Komplek Dasamaya 2 RT.16 Blok N Kel. Alalak Selatan Kec. Banjarmasin Utara Kota Banjarmasin.', 'Mohon info, apakah bangunan rumah baru di Blok N (dekat posko BPK Gempita) Kel. Alalak Selatan. Alamat: Jl. HKSN Komplek Dasamaya 2 RT.16 Blok N Kel. Alalak Selatan Kec. Banjarmasin Utara Kota Banjarmasin. Apakah sudah ada ijinnya ?. Tkb.', NULL, 88, '2022-08-12 03:08:05', '2022-08-15 08:54:56', 11, 2, 157, NULL, '15-08-2022-608IMG-20220815-WA0123.jpg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (19, 4, 36, 'Jalan Veteran Rt. 14. Kel. Pengambangan Kec. Banjarmasin Timur, tepatnya di depan halaman 88 home store atau indomaret atau depan rocket chicken dibawah papan reklame bank bjb dan reklame indomaret', 'Kami para penyewa toko dan pemilik reklame keberatan dengan adanya seorang jual pentol yang mangkal dari jam 10 pagi sampai jam 9 malam, karena menggangu akses di halaman masuk toko toko kami, agar pihak berwenang dapat menindak dan kami sudah memenuhi kewajiban untuk retribusi reklame tersebut namun paman pentol seenaknya berjualan dibawah reklame dan halaman toko kami', '18-08-2022-89631.jpeg', 90, '2022-08-18 01:48:01', '2022-08-18 03:21:50', 1, 2, 157, 'Menindak lanjuti laporan bahwa ada orang berjualan didepan toko indomaret', '18-08-2022-3508IMG-20220818-WA0008.jpg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (20, 3, 30, 'Komplek kebun jeruk permai RT.16', 'Assalamualaikum\r\nBapak mohon ditindak lanjuti di wilayah kerja uln Puskesmas Alalak Selatan ada ODGJ berkeliaran tanpa busana\r\nMohon bantuannya utk di amankan karena cukup meresahkan warga sekitar \r\nterimakasih atas bantuannya.', '18-08-2022-8451C85B2F93-E165-445E-9E41-B49E5673CBAC.jpeg', 91, '2022-08-18 06:45:03', '2022-08-24 00:05:57', 18, 2, 157, 'ODGJ telah dibawa ke rumah singgah', '24-08-2022-8316C76C987D-8CB3-40F7-A8AB-8A99DCC92B38.jpeg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (21, 3, 23, 'jalan cemara raya no 13', 'sampah berserakan disepanjang jalan sampai mengganggu tempat usaha saya,kondisinya parah sekali padahal jarak toko dan tps terhalang jembatan,tolong dinas terkait segera proses ketertiban kebersihan di daerah tps cemara raya karena itu usaha saya', '31-08-2022-9983IMG-20220831-WA0004.jpg', 92, '2022-08-31 14:30:18', '2022-09-06 05:20:16', 12, 2, 67, 'Izin melaporkan bahwa sampah didepan toko telah steril dari sampah dan bersih.', '06-09-2022-4875540BD85-9E9C-434F-B9EF-D12EDF94867E.jpeg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (23, 1, 9, 'jl. teluk tiram (depan smpn 4 banjarmasin)', 'Bangunan liar yang dijadikan tempat minum-minuman keras, mabuk-mabukan, memalak. sehingga mengganggu dan meresahkan lingkungan.tolong dibongkar bangunan liar tersebutlokasi jl. teluk tiram (depan smpn 4 banjarmasin)', '08-09-2022-6482WhatsApp Image 2022-09-08 at 08.46.19.jpeg', 94, '2022-09-08 01:49:01', '2022-09-08 06:03:07', 11, 2, 157, 'Mohon izin, anggota telah menindak lanjuti laporan tetapi tidak dapat membongkar dikarenakan pemilik bangunan tidak ada di tempat dan warga yang mabuk-mabukan bukan orang setempat', '08-09-2022-360WhatsApp Image 2022-09-08 at 11.04.35.jpeg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (28, 4, 39, 'Jl. Pramuka Komplek Green Pramuka', 'Ada aktivitas musik hiburan yang menimbulkan kegaduhan di dalam kompmek green pramuka sampai hampir jam 22.00 wita masih ribut. Kami warga merasa terganggu. Tolong di TL sekarang', NULL, 96, '2022-09-11 13:35:18', '2022-09-11 22:41:47', 20, 2, 157, NULL, '11-09-2022-22390DB5EA68-0F99-4C8E-B207-C529A9FA806C.jpeg');
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (30, 3, 28, 'Jln. Alalak Utara Rt.3 Rw.1', '1 hari yg lalu ODGJ nya membanting anak kecil sampai tesilahu pas lagi gang sepi. \r\nMohon bantuan nya pak/bu. \r\nnama ODGJ nya Radiansyah (Krna sering ngelemfox jadi gila)\r\nsekali lagi tolong rahasiakan identitas ulun. \r\ndan tolong kami karna sangat meresahkan banar sudah, kasian anak kecil.', NULL, 98, '2022-09-22 13:25:10', '2022-09-22 23:02:12', 18, 1, NULL, NULL, NULL);
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (32, 2, 13, 'Pasar Sudimampir', 'Pak mohon ditindak lanjuti PKL dipasar ini, sangat mengganggu pedagang dan pembeli toko. \r\nPKL nya sesuka mungkin menaruh dangan didepan toko , kasian pembeli susah liat barang. kadang kalo padat malah pemilik toko/ pembeli yang dimaharin nya. \r\n\r\nberi arahan untuk jualan keliling pak, biar jalanan gak macet , coba pian lihat aja foto nya  sprti punya toko sendiri PKL nya.\r\nsatpam pasar nya juga tolong beri arahan , ajarin cara menegur pkl sm pengamen dpsr.', '12-10-2022-1681B1E603C2-CC39-4C42-8DB3-4D2BF2F6F41F.jpeg', 102, '2022-10-12 18:11:08', '2022-10-16 23:57:42', 1, 1, NULL, NULL, NULL);
INSERT INTO `keluhan` (`id`, `kecamatan_id`, `kelurahan_id`, `alamat`, `isi`, `foto_keluhan`, `user_id`, `created_at`, `updated_at`, `kategori_id`, `status`, `solver`, `keterangan`, `foto_selesai`) VALUES (36, 4, 34, 'Jln veteran no 17a', 'Pedagang sate menutupi toko kita ..mohon di tindak lanjuti...mereka pintar saat jam 3 siang baru berjualan..sementra bapak2 satpol pp sdh pulang', '13-11-2022-405220221113_175332.jpg', 110, '2022-11-13 10:11:12', '2022-11-13 13:37:31', 1, 1, NULL, NULL, NULL);
